import config from '../config/index';

const loadImages = async () => {
  const { pixabay } = config;
  console.log('pixabay', pixabay, 'pixabay', pixabay.key);
  const response = await fetch(`${pixabay.url}?key=${pixabay.key}q=yellow+flowers&image_type=photo`,
  {
    mode: 'no-cors',
    headers: {
      'Access-Control-Allow-Origin':'*'
    }
  });
  console.log('Respo', response);
  return response; 
};

export default {
  loadImages
};
